import React from 'react';
import { Grid, CircularProgress,Button } from '@material-ui/core';
import { useSelector } from 'react-redux';

import Event from './Event/Event';

const Events = ({ setCurrentId, date }) => {
    const events = useSelector((state) => {
        let events = [];
        state.events.map((event) => { if (event.date === date) { events.push(event) } });
        console.log(events);
        return events;
            });
    
    const h = () => {
        console.log(events);
    }

    return (
        <>
            <Button onClick={h}>HIHIHIHI</Button>
            {!events.length ? <CircularProgress /> : (
                <Grid container alignItems="stretch" spacing={3}>
                    {events.map((event) => (
                        <Grid key={event._id} item xs={12} sm={6} md={6}>
                            <Event event={event} setCurrentId={setCurrentId} />
                        </Grid>
                    ))}
                </Grid>
            )}

        </>
    );
};

export default Events;
